import React from 'react'
import JoinSpace from './JoinSpace'
import '../assets/css/Container.css'


const Cointainer = () => {
    return (
        <div class="container">
            <div class="row justify-content-center">
                <div class="col"></div>
                <div class="col-8 border">
                    <JoinSpace />
                </div>
                <div class="col"></div>
            </div>
        </div>
    );
}

export default Cointainer;
